import "./First.css";

export default function First() {
  return (
    <div className="flex">
      <div>
        <img src="img/img1.png" alt="firstimg" className="hand"></img>
      </div>
      <img src="img/img2.png" alt="firstimg" className="hand"></img>
      <img src="img/img3.png" alt="firstimg" className="hand"></img>
    </div>
  );
}
